import React from "react";
import ResultTableItem from "./ResultTableItem";

const ResultTableList = (props) => {
  console.log("ResultTableList");
  console.log(props);
  return (
    <tr>
      <td>{props.year}</td>
      <td>{props.yearlyInterest}</td>
      <td>{props.savingEndOfYear}</td>
      <td>{props.yearlyContribution}</td>
      <td>{}</td>
      {/* {props["results"].map((item) => {
        console.log(item);
      })} */}
      {/* <ResultTableItem
        year={item["year"]}
        yearlyInterest={item["yearlyInterest"]}
        savingEndOfYear={item["savingEndOfYear"]}
        yearlyContribution={item["yearlyInterest"]}
      /> */}
    </tr>
  );
};

export default ResultTableList;
